import "./App.css";
import React from "react";
import BrowserRouter from "react-router-dom"
import Customer from "./components/Customer";
function App() {
  return (
    <div className="App">
      <header className="App-header">

      </header>
      <main>
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<Customer/>}/>
          </Routes>
        </BrowserRouter>
      </main>
    </div>
  );
}

export default App;
